import React, { Component } from 'react'
import Head from 'next/head'

export class index extends Component {
  render() {
    return (
      <div>
        <Head>
          <title>OLOLO</title>
          </Head>
        <h1>Test</h1>
      </div>
    )
  }
}

export default index
